	static int longestSubstrWithoutRepeatingChars(String s)
	{
	    if (s == null || s.isEmpty()) return 0;

	    int max = 0;

	    HashSet<Character> subStrChars = new HashSet<>();

	    for (int i = 0 ; i < s.length() ; i++)
	    {
	        char c = s.charAt(i);
	        
	        if (subStrChars.add(c))
	        {
	            max = Math.max(max, subStrChars.size());
	        }
	        else
	        {
	            /* Remove chars up to duplicate */
	            for (int j = i - subStrChars.size() ; j < i ; j++)
	            {
	                char toRemove = s.charAt(j);

	                if (c == toRemove) break; /* No need to remove the current. */

	                subStrChars.remove(toRemove);
	            }
	        }
	    }

	    return max;
	}
	
	public static int lengthOfLongestSubstring3(String s) {
	    if(s==null||s.length()==0){
	        return 0;
	    }
	 
	    HashSet<Character> set = new HashSet<>();
	    int result = 1;
	    int i=0; 
	    for(int j=0; j<s.length(); j++){
	        char c = s.charAt(j);
	        if(!set.contains(c)){
	            set.add(c);
	            result = Math.max(result, set.size());
	        }else{
	            while(i<j){
	                if(s.charAt(i)==c){
	                    i++;
	                    break;
	                }
	 
	                set.remove(s.charAt(i));
	                i++;
	            }
	        }    
	    }
	 
	    return result;
	}
	
	public static int lengthOfLongestSubstring4(String s) {
        if(s==null)
            return 0;
	boolean[] flag = new boolean[256];
 
	int result = 0;
	int start = 0;
	char[] arr = s.toCharArray();
 
	for (int i = 0; i < arr.length; i++) {
		char current = arr[i];
		if (flag[current]) {
			result = Math.max(result, i - start);
			// the loop update the new start point
			// and reset flag array
			// for example, abccab, when it comes to 2nd c,
			// it update start from 0 to 3, reset flag for a,b
			for (int k = start; k < i; k++) {
				if (arr[k] == current) {
					start = k + 1; 
					break;
				}
				flag[arr[k]] = false;
			}
		} else {
			flag[current] = true;
		}
	}
 
	result = Math.max(arr.length - start, result);
 
	return result;
}
	
	public static int lengthOfLongestSubstring2(String s) {
		HashMap<Character, Integer> mpp = new HashMap<Character, Integer>();
		int left = 0, right = 0;
		int n = s.length();
		int len = 0;
		while (right < n)
			if (mpp.containsKey(s.charAt(right)))
				left = Math.max(mpp.get(s.charAt(right)) + 1, left);
		mpp.put(s.charAt(right), right);
		len = Math.max(len, right - left + 1);
		right++;
		return len;

	}
	
